function Example() {
  const [checked, setChecked] = React.useState({
    Cookies: false,
    Pizza: false,
    Icecream: false
  });

  return (
    <List>
      {['Cookies', 'Pizza', 'Icecream'].map(key => (
        <ListItem
          key={key}
          onClick={() =>
            setChecked({ ...checked, [key]: !checked[key] })
          }
        >
          {key}
          <ListItemMeta>
            <Checkbox checked={checked[key]} readOnly />
          </ListItemMeta>
        </ListItem>
      ))}
    </List>
  );
}

